import useFetch from "./useFetch";


const Listprojects = () => {

    const { data, isPending, error } = useFetch('http://127.0.0.1:5000/projects/all')

    return ( 
    <>
        { error && <div>{ error }</div> }
        { isPending && <div>Loading...</div> }
        {data && (
            <ul>
                {data.map(blog => (
                    <div className="project-preview" key={data.id}>
                    <h2>Name:</h2>
                    <p>{blog.Name}</p>
                    </div>
                ))}
            </ul>
        )}  
    </>

        
     );
}
 
export default Listprojects;
